This is a deck to counter those pesky Elemental HEROS, can be used against Neo-Spacians.

This is only a prototybe, meant to fail eventually.

&nbsp;

OK, I know I'm late as f**k, but I got DOOM Eternal this month, and I absolutely love the game! So for my final deck profile of 2020, I made this go-second Burning Abyss build named after the most famous song in the game's soundtrack! 

&nbsp;

&nbsp;

As I just said, this is a Burning Abyss deck meant to go second every single game. I'm not sure how to improve the deck, but I'm gonna give you the run down on its strategy.

&nbsp;

The goal is to summon Dante--ideally while you also control Cherubini, Ebon Angel of the Burning Abyss. When you attack with Dante, then you summon Divine Arsenal AA-ZEUS - Sky Thunder, who is basically the BFG-9000 of Yu-Gi-Oh! AA-ZEUS by itself is broken. Sending Burning Abyss monsters to the graveyard to activate its nuke effect is OP, especially since you can send Scarm to the Graveyard to search a Tour Guide, or Dante to add Cir to the hand.

&nbsp;

And to make matters worse, if this thing is in a zone that Cherubini points to, it can't be destroyed by card effects!

&nbsp;

Now, an indestructible AA-ZEUS isn't this card's only strategy. If you're able to OTK, you can make Borrelsword Dragon or Accesscode Talker. As an alternative, you can link summon Mekk-Knight Crusadia Avramax with I:P Masquerena to make a near-unkillable boss monster!

This is an Infinitrack deck that's meant to turbo out Divine Arsenal AA-ZEUS - Sky Thunder. And no, this is not a JoJo reference. This deck is a reference TO a JoJo reference! https://ygoprodeck.com/road-roller-da/

&nbsp;

Infinitrack is already an Xyz deck that focuses on going second and attacking with strong monsters. In addition to that, the "Infinitrack" Xyz Monsters attach the monsters they destroy by battle as material, and Infinitrack Goliath can attach itself to one of them (Which protects any Machine-type Xyz Monster it's attached to from being destroyed by card effects). So naturally, AA-ZEUS would be a welcome addition to the deck...

&nbsp;

That is, if not for the fact that Infinitrack Brutal Dozer locks you into EARTH Machines if you use its second effect, which makes it one of the most important cards in the archetype. Because of this restriction, I decided to put Brutal Dozer in the Side Deck.

&nbsp;

Anyways, if you manage to get an AA-ZEUS that has Infinitrack Goliath attached as material, you get a 3K beatstick that can nuke the field, and can't be destroyed by effects. And the fact that you can banish Infinitrack Tunneler or Trencher from your Graveyard to either revive an Infinitrack or draw 2 cards makes AA-ZEUS even better for the deck!

&nbsp;

Finally, if you put Brutal Dozer in the Main Deck, make sure to put the 3 copies of Electro-Magnetic Railgun there too. Since Brutal Dozer stops you from summoning AA-ZEUS, you can use Railgun to tribute one of your Machine monsters and destroy 1 card on the field for every 1000 ATK that monster had.

&nbsp;

