&nbsp;

<b>What you need -</b>

&nbsp;

<b>Lulu/Lili + Kawaloon + any 1 VW monster except Nyannyan</b>

&nbsp;

<b>What you end on -¬†</b>

&nbsp;

&nbsp;
<ul>
 	<li aria-level="1"><b>The entire thing is Nibiru proof (Gossip shadow)</b></li>
</ul>
