&nbsp;

<span>Virtual world is a Tier 1 competition of the current metagame and took - 1st LCS 8, 2nd LCS 8 and 1st LCS 9. The deck is very powerful being able to being able to turbo out True King of all Calamities very consistently, end on zeus with 4 materials at the worst case, be nibiru proof (number 75), Have multiple sources of removal (Utopia Beyond to counter Dragoon, Jaja, Break Sword, Constellar M7) and have a level 9 synchro monster on the field that if sent to the graveyard off of true king or simply just sent there - can recur itself back and is literally a Macros Cosmos (any card sent from the field to the graveyard is banished instead). This is all as of now and it gets better. There is new support of this deck that makes the deck more consistent and even better! The combos also end on a much higher note! The 2 new cards coming are Virtual world Rabbit - Tutu and Virtual World Gate - Zhuangwoo. Tutu is trash so this deck does not run it but Zhuangwoo is actually really good. You never really want to set it because it‚Äôs field effect is really bad. It is only good because of it‚Äôs monster reborn effect you can activate by banishing it from the graveyard. If you draw it you can simply discard it to resolve Qinglong so it is not a brick. It can extend the combo and also serve as an extender paired up with Foolish Burial goods!¬†</span>

&nbsp;

<span>If you want to learn how to do this combo, I highly recommend watching my Youtube video - in it I explain the entire deck in-depth and all of my card choices and also tell you how to do the combo. In this video I only do the Nibiru proof combo so if you want to learn how to do the ‚Äònormal‚Äô combos as well check out my other video! I also have a 1st Place LCS 8 Virtual world deck video if you are interested in that. Also consider answering the poll question down below! Today‚Äôs poll question is: What are your favorite decks of all time, and what is your favorite archetype/card?</span>

