...Alright so...here is my first Galaxy/Photon deck, revolving around Galaxy-Eyes Cipher Ex Dragon. I'm very much new to that archetype, in terms of playing it. Up until now, I've only played against it. Because of that, some advice on how to improve this deck would be GREATLY appreciated.

&nbsp;

Anyways, this deck's main goal is to go second because of Cipher Ex Dragon's first effect, which lets you detach two Xyz Materials from it to make your LIGHT monsters untargetable until the end of your opponent's turn. Basically, your strategy is to summon Galaxy-Eyes Cipher Dragon (without using its effect), then summon Cipher Ex Dragon with it and use that effect. Then you attack with your Xyz monsters, and use Cipher Ex Dragon to summon AA-ZEUS during your Main Phase 2. And because AA-ZEUS is a LIGHT monster, your opponent can't target it with any card effects until their turn is over.

&nbsp;

The end result of this strategy is that your opponent will be left to deal with an untargetable, 3000 ATK beatstick that can nuke the field. And if Galaxy-Eyes Afterglow Dragon is detached to activate AA-ZEUS's effect, Afterglow Dragon can either use its second effect to attach a Galaxy-Eyes Photon Dragon from the hand or Deck to ZEUS so that it can activate its effect again. Alternatively, Afterglow Dragon's effect can summon it to your field so that you can deal at least 6000 battle damage on your next turn.

&nbsp;

So, the Ace Monsters of this deck are Galaxy-Eyes Afterglow Dragon, Photon Dragon, Cipher Ex Dragon, and AA-ZEUS.

Because of this deck's primary goal, and AA-ZEUS's appearance, this deck is named "Galaxy Gundam."
